Bijgesloten is de zojuist ontvangen uitnodiging voor de uitreiking van de herinneringsmedaille aan de leden van het detachement van Air Taskforce Middel East 7 (ATFME-7), inclusief het Re-Deployment Element (RDE), op vrijdag 7 oktober 2016 van 13:00-17:15 uur op Vliegbasis Leeuwarden. Op 7 oktober heeft uw commissie ook een werkbezoek aan het Militair Revalidatiecentrum, wat naar verwachting tot een minimale deelname aan de medaille-uitreiking zal leiden. De Defensie-organisatie is daarvan op de hoogte.&nbsp;<br />
